import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import Button from '../Button/Button';
import InputModel from '../Input/Input';
import FormWrapper from '../FormWrapper/FormWrapper';

interface FormProps {
    buttonText: string;
    onSubmit(data: any): void;
}

const FormLogin: React.FC<FormProps> = ({ buttonText, onSubmit }) => {
    const { register, handleSubmit, formState: { errors } } = useForm();

    const submitForm = (data: any) => { 
        onSubmit(data);
    };

    return (
        <>

        <FormWrapper heading="Entre na sua conta" onSubmit={handleSubmit} buttonText="Login">
            <FormLogin onSubmit={handleSubmit} buttonText="Login" />
        </FormWrapper>

            <form 
                onSubmit={handleSubmit(submitForm)}  
                className="w-full my-5" 
                action="#" 
                method="POST"
            >
               
                <Button text={buttonText} />

            </form>

            <hr />

            <div className="flex flex-col gap-3 my-5">
                <a
                    className="w-full text-center p-4 font-medium border border-black 
                    rounded-xl hover:bg-black hover:text-white text-heading-blue-secondary text-2xl flex justify-center gap-2"
                    href=""
                >
                    <img src="/Google.svg" className="w-7" alt="Google Icon" /> Continue with Google 
                </a>
                <p className="text-gray-600 text-lg">
                    NÃ£o tem conta ainda? <Link className="hover:underline" to="/Register">Cadastre-se</Link>
                </p>
            </div>
        </>
    );
}

export default FormLogin;
